import csv
import os
import json
from flask import Flask, request, jsonify, send_file

app = Flask(__name__)

# In-memory storage for submissions
submissions = []
flexfields = {}
performance_data = {}
D1_file_path = 'D1_file.json'


class Submission:
    def __init__(self, title, description, flexfields=None):
        self.title = title
        self.description = description
        self.flexfields = flexfields or {}
        self.errors = []

    def validate(self):
        if not self.title:
            self.errors.append("Title is required.")
        if not self.description:
            self.errors.append("Description is required.")
        if len(self.errors) > 0:
            return False
        return True


def validate_csv(file):
    if not file.filename.endswith('.csv'):
        return False
    return True


@app.route('/submit', methods=['POST'])
def create_submission():
    data = request.json
    submission = Submission(data.get('title'), data.get('description'), data.get('flexfields'))

    if not submission.validate():
        return jsonify({'errors': submission.errors}), 400

    submissions.append(submission)
    return jsonify({'message': 'Submission created successfully.'}), 201


@app.route('/upload', methods=['POST'])
def upload_file():
    if 'file' not in request.files:
        return jsonify({'error': 'No file part'}), 400

    file = request.files['file']

    if not validate_csv(file):
        return jsonify({'error': 'Invalid file format. Please upload a CSV file.'}), 400

    try:
        data = file.read().decode('utf-8')
        csv_reader = csv.reader(data.splitlines())
        next(csv_reader)  # Skip header
        for row in csv_reader:
            # Process each row
            print(row)  # Replace this with actual processing logic
    except Exception as e:
        return jsonify({'error': str(e)}), 500

    return jsonify({'message': 'File uploaded successfully.'}), 200


@app.route('/report', methods=['GET'])
def generate_report():
    report = {
        'submissions': [submission.__dict__ for submission in submissions],
        'flexfields': flexfields,
        'performance_data': performance_data
    }
    return jsonify(report)


@app.route('/add_flexfield', methods=['POST'])
def add_flexfield():
    data = request.json
    flexfield_name = data.get('name')

    if flexfield_name in flexfields:
        return jsonify({'error': 'Flexfield already exists.'}), 400

    flexfields[flexfield_name] = data.get('value')
    return jsonify({'message': 'Flexfield added successfully.'}), 201


@app.route('/validate_performance', methods=['POST'])
def validate_performance():
    # Here we could implement some logic to test performance
    num_flexfields = len(flexfields)
    performance_data = {'num_flexfields': num_flexfields}
    return jsonify(performance_data)


@app.route('/update_data', methods=['POST'])
def update_data():
    data = request.json
    with open(D1_file_path, 'w') as f:
        json.dump(data, f)
    return jsonify({'message': 'Data updated and D1 file generated successfully.'}), 200


@app.route('/download', methods=['GET'])
def download_file():
    if not os.path.exists(D1_file_path):
        return jsonify({'error': 'File not found.'}), 404

    return send_file(D1_file_path, as_attachment=True)


if __name__ == '__main__':
    app.run(debug=True)
